import { Component } from '@angular/core';
import {User} from '../../models/user';

@Component({
  selector: 'app-table',
  templateUrl: './table.component.html',
  styleUrls: ['./table.component.css']
})
export class TableComponent {
  userArray : User[] = [
    {username:'pepe',password:12134,confirmatedPassword:12134,email:'Hola',country:'espana',subscription:true,city:'jkha',id:1}
   ]
}
